import { useState, useEffect } from 'react';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';

function NavScroll() {
  const [activeLink, setActionLink] = useState('home');
  const [scolled, setScolled] = useState(false);

  useEffect(() => {
    const onScolled = () => {
      if (window.scrollY > 50) {
        setScolled(true);
      } else {
        setScolled(false);
      }
    }
    window.addEventListener('scroll', onScolled);
    return () => {
      window.removeEventListener('scroll', onScolled);
    }
  }, [] );

  const onUpdateActiveLink = (value) => {
    setActionLink(value);
  }

  return (
    <Navbar expand="lg" className={scolled ? "scolled": ""}>
      <Container>
        <Navbar.Brand href="#home">
          <img src= {''} alt='Logo'/>
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav">
          <span className="navbar-toggler"></span>
        </Navbar.Toggle>
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav
            className="me-auto"
          >
            <Nav.Link href="#home" className={activeLink === 'home' ? 'active-navbar-link' : 'navbar-link'} onClick={() => onUpdateActiveLink('home')}>Home</Nav.Link>
            <Nav.Link href="#skills" className={activeLink === 'skills' ? 'active-navbar-link' : 'navbar-link'} onClick={() => onUpdateActiveLink('skills')}>Skills</Nav.Link>
            <Nav.Link href="#projects" className={activeLink === 'projects' ? 'active-navbar-link' : 'navbar-link'} onClick={() => onUpdateActiveLink('projects')}>Projects</Nav.Link>
          </Nav>
          <span className='navbar-text '>
            <div className='social-icon'>
              <a href='#'><img src='' alt='' /></a>
              <a href='#'><img src='' alt='' /></a>
              <a href='#'><img src='' alt='' /></a>
            </div>
            <button className='vvd' onClick={() => console.log('Connect')}> <span>Let's Connect</span></button>
            </span>

        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default NavScroll;
